import React from 'react';
import s from './Dialogs.module.css'
import NavLink from "react-router-dom/es/NavLink";

const user = [
    {
        id: 1,
        name: 'Роман'
    },
    {
        id: 2,
        name: 'Сергей'
    },
    {
        id: 3,
        name: 'Артем'
    },
    {
        id: 4,
        name: 'Катя'
    },
    {
        id: 5,
        name: 'Маша'
    },
    {
        id: 6,
        name: 'Яна'
    }

];



const DialogItem = (props) => {

    return (
        <div className={s.dialog}>
            user.map(el =>{
            <NavLink to={'/dialogs/' + el.id} activeClassName={s.active}> {el.name}</NavLink>
        })

        </div>
    )
};

const Massage = (props) => {
    return (
        <div className={s.massage}>{props.massage}</div>
    )
}

const Dialogs = (props) => {
    return (
        <div className={`${s.dialogs} ${s.grid}`}>
            <div className={s.dialogsItem}>
                <DialogItem />
                <DialogItem />
                <DialogItem />
                <DialogItem />
                <DialogItem />
                <DialogItem />

            </div>
            <div className={s.massages}>
                <Massage massage='Привет'/>
                <Massage massage='Привет, как дела? '/>
                <Massage massage='Привет, с ДР тебя!!!!!'/>

            </div>


        </div>
    )
};


export default Dialogs;
